import { useState, useEffect } from "react";
import axios from 'axios';
import './list.scss';

const List = () => {
  const [musical, setMusical] = useState([]);

  const fetchMusicals = async () => {
     const response = await axios.get(
       'https://yo-onhye.github.io/00.practice-musical-list/db.json'
     );
     setMusical(response.data);
  };

  useEffect(() => {
    fetchMusicals();
  }, []);

  console.log(musical.musicalClasses)

  return (
    <div className="cont_musical">
      <ul className="list_musical">
        {musical.musicalClasses.length > 0 && musical.map(item => (
          <li className="item_musical">
            <span class="item_thumb">
              {item.image}
            </span>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default List;
